typedef struct Goblin{
    // Location of goblin
    unsigned int x_pos;
    unsigned int y_pos;

    // health of the goblin
    unsigned char health;
    // speed of the goblin
    unsigned char speed;
    // current goblin state
    unsigned char state;
    // Used to determine the current frame of the animation
    unsigned char current_frame;
    // Used to determine the number of frames in the current animation being played
    unsigned char frames_in_animation;
      // Boolean to determine direction of travel
    bool right;
    bool left;
    bool down;
    bool up;
    // next pointer
    struct Goblin* next;
}Goblin;
// sets up back buffer for double buffering
void init_double_buffer(volatile int * pcp);
// populates list of goblins
void populate_goblin_list();
// plots a single pixel onto the back frame buffer
void plot_pixel(int x, int y, short int colour);
// draws an enemy sprite starting from its top left corner (x_offset, y_offset)
void draw_enemy_sprite_frame(unsigned short int sprite_ptr[][288], unsigned int x_offset, unsigned int y_offset, unsigned int frame_idx, unsigned int num_frames, bool reverse);
int pixel_buffer_start; // global variable
void wait_for_vsync();
// Clears the screen to black
void clear_screen();
// draw any objects
void draw();
// Function to add a Goblin to the list
void add_goblin(Goblin** head, Goblin* new_goblin);
// Function to create a new Goblin
Goblin* create_goblin(unsigned int x, unsigned int y, unsigned char health, 
                      unsigned char speed, unsigned char state, 
                      unsigned char frame, unsigned char frames, bool right, bool left, bool up, bool down);
                      // returns whether or not a sprite is within the screen
bool in_bounds(unsigned int x, unsigned int y, unsigned int width, unsigned int height);

// list of goblins
Goblin* goblinList = NULL;
// double buffering and black buffer
short int BlackBuffer[240][512] = {0};
short int Buffer1[240][512]; // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];
volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
int main(void){   
    init_double_buffer(pixel_ctrl_ptr);
    populate_goblin_list();
    while (1) {   
        draw();
    }
}
// populates list of goblins
void populate_goblin_list(){
    for(unsigned int i = 0; i < 10; i ++){
        // 8 possible directions
        unsigned int dir = rand() % 8;
        bool left = false, right = false, up = false, down = false;
        // set direction booleans
        switch(dir){
            // right
            case(0):
                right = true;
                break;
            // up and to the right
            case(1):
                right = true;
                up = true;
                break;
            // up
            case(2):
                up = true;
                break;
            // up and to the left
            case(3):
                up = true;
                left = true;
                break;
            // left
            case(4):
                left = true;
                break;
            // down and to the left
            case(5):
                left = true;
                down = true;
                break;
            // down
            case(6):
                down = true;
                break;
            // down and to the right
            default:
                down = true;
                right = true;
        }
        Goblin* g = create_goblin(rand() % SCREEN_WIDTH, rand() % SCREEN_HEIGHT, 100, rand() % GOBLIN_MAX_SPEED, 0x0, 0, 6, right, left, up, down); // state: 0 for walk 1 for attack
        // add new goblin to linked list
        add_goblin(&goblinList, g);
    }       
}
// sets up back buffer for double buffering
void init_double_buffer(volatile int * pcp){
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pcp;

    /* set front pixel buffer to Buffer 1 */
    *(pcp + 1) = (int) &Buffer1; // first store the address in the back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    clear_screen();
    wait_for_vsync();
    /* set back pixel buffer to Buffer 2 */
    *(pcp + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pcp + 1); // we draw on the back buffer
    clear_screen();
}
// draw all enemies and sprites
void draw(){
    clear_screen();
    // iterate through goblins
    Goblin* gob = goblinList;
    while(gob != NULL){
        // update goblin parameters
        int dx = gob->left || gob->right ? gob->speed : 0;
        int dy = gob->up || gob->down ? gob->speed : 0;
        dx = gob->left ? -dx : dx;
        dy = gob->right ? dy : -dy;
        // temp new x and y coordinates
        unsigned int new_x = gob->x_pos + dx;
        unsigned int new_y = gob->y_pos + dy;
        // update boolean parameters based on whether or not next move is in bounds
        if(!in_bounds(new_x, new_y, 48, 48)){
            if(new_x == 0){
                gob->right = true;
                gob->left = false;
            }
            if(new_x + 48 == SCREEN_WIDTH - 1){
                gob->right = false;
                gob->left = true;
            }
            if(new_y == 0){
                gob->up = true;
                gob->down = false;
            }
            if(new_y + 48 == SCREEN_HEIGHT - 1){
                gob->up = false;
                gob->down = true;
            }
            // new dx and dy 
            dx = gob->left || gob->right ? gob->speed : 0;
            dy = gob->up || gob->down ? gob->speed : 0;
            dx = gob->left ? -dx : dx;
            dy = gob->right ? dy : -dy;
        }
        
        // update x and y pos
        gob->x_pos += dx;
        gob->y_pos += dy;
        // select sprite sheet for drawing
        unsigned short int** sprite_sheet;
        // reverse for right movement
        bool reverse = false;
        // goblin moving up
        if(gob->up && !gob->down){
            sprite_sheet = gob->state == 0x0 ? goblin_U_Walk : goblin_U_Attack;
        
        // goblin moving down
        } else if(gob->down && !gob->left && !gob->right && !gob->up){
            sprite_sheet = gob->state == 0x0 ? goblin_D_Walk : goblin_D_Attack;

        // goblin moving right
        }else if(!gob->left && gob->right && !gob->up){
            reverse = true;
            sprite_sheet = gob->state == 0x0 ? goblin_S_Walk : goblin_S_Attack;
        
        // goblin moving left
        }else if(gob->left && !gob->right && !gob->up){
            sprite_sheet = gob->state == 0x0 ? goblin_S_Walk : goblin_S_Attack;
        }
        draw_enemy_sprite_frame(sprite_sheet, gob->x_pos, gob->y_pos, gob->current_frame, gob->frames_in_animation, reverse);
    }
    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}
// returns whether or not a sprite is within the screen
bool in_bounds(unsigned int x, unsigned int y, unsigned int width, unsigned int height){
    return x > 0 && x + width - 1 < SCREEN_WIDTH && y > 0 && y + height < SCREEN_HEIGHT;
}
// draws an enemy sprite starting from its top left corner (x_offset, y_offset)
void draw_enemy_sprite_frame(unsigned short int sprite_ptr[][288], unsigned int x_offset, unsigned int y_offset, unsigned int frame_idx, unsigned int num_frames, bool reverse){
    // iterate through the height of a frame
    unsigned int sheet_height = ARRAYSIZE(sprite_ptr);
    unsigned int sheet_width = ARRAYSIZE(sprite_ptr[0]);
    unsigned int frame_width = sheet_width / num_frames;

    for(unsigned int i = 0; i < sheet_height; i++){
        // iterate through the width of a frame
        for(unsigned int j = 0; j < frame_width; j++){
            // Calculate the index to read from the sprite sheet based on direction
            unsigned int sprite_index = reverse ? (frame_width - 1 - j) : j;
            sprite_index += (frame_width * frame_idx);

            // Calculate the x position to draw on the screen based on direction
            unsigned int x_draw = reverse ? x_offset + (frame_width - 1 - j) : x_offset + j;

            // remove background and draw pixel if it's not white (0xFFFF)
            if(sprite_ptr[i][sprite_index] != 0xFFFF){
                plot_pixel(x_draw, y_offset + i, sprite_ptr[i][sprite_index]);
            }
        }
    }
}


void wait_for_vsync() {
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    int status;

    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while((status & 1) != 0x0){
        status = *(pixel_ctrl_ptr + 3);
    }
}
void clear_screen() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;
  int *back_buffer = *(pixel_ctrl_ptr + 1);
  memcpy(back_buffer, BlackBuffer, sizeof(BlackBuffer));
}
void plot_pixel(int x, int y, short int colour){
    short int *one_pixel_address;

    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

    *one_pixel_address = colour;
}

// Function to create a new Goblin
Goblin* create_goblin(unsigned int x, unsigned int y, unsigned char health, 
                      unsigned char speed, unsigned char state, 
                      unsigned char frame, unsigned char frames, bool right, bool left, bool up, bool down) {
    Goblin* new_goblin = (Goblin*)malloc(sizeof(Goblin));
    if (new_goblin == NULL) {
        // cant allocate mem
        return NULL;
    }
    
    // Initialize goblin properties
    new_goblin->x_pos = x;
    new_goblin->y_pos = y;
    new_goblin->health = health;
    new_goblin->speed = speed;
    new_goblin->state = state;
    new_goblin->current_frame = frame;
    new_goblin->frames_in_animation = frames;
    new_goblin->right = right;
    new_goblin->left = left;
    new_goblin->up = up;
    new_goblin->down = down;
    new_goblin->next = NULL;

    return new_goblin;
}

// Function to add a Goblin to the list
void add_goblin(Goblin** head, Goblin* new_goblin) {
    if (*head == NULL) {
        // If the list is empty, the new goblin becomes the head
        *head = new_goblin;
    } else {
        // Otherwise, find the end of the list and add the new goblin there
        Goblin* current = *head;
        while (current->next != NULL) {
            current = current->next;
        }
        current->next = new_goblin;
    }
}